<script>
$('#login-form').on('submit', function(e) {
    e.preventDefault();
    $.ajax({
        url: 'ajax_login.php',
        method: 'POST',
        data: $(this).serialize(),
        success: function(response) {
            let res = JSON.parse(response);
            if(res.status === 'success') {
